import './App.css';
import Home from './Components/Home';
import Project from './Components/Project';
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        <Route path='projects/ecommerce' element={<Project />}></Route>
      </Routes>
    </div>
  );
}

export default App;
